{"content": "\u6211\u6765\u81ea\u56db\u5ddd\u7701\u51c9\u5c71\u5dde\u6728\u91cc\u53bf.\u6211\u4eec\u6728\u91cc\u53bf\u8d2a\u5b98\u8150\u8d25\u5b58\u5728\u7684\u592a\u591a.\u6240\u4ee5\u4e2d\u592e\u8981\u91cd\u89c6\u6211\u8981\u4e3e\u62a5\u6728\u91cc\u53bf\u5e72\u90e8\u5de5\u4f5c\u4e0d\u8ba4\u771f\u4e0d\u8d1f\u8d23\u4efb\uff0c\u6bd4\u4e2a\u4f8b\u5b50\u5427\u6211\u4eec\u54ea\u4e2a\u6751\uff0c\u6728\u91cc\u53bf\u514b\u5c14\u4e61\u4e0a\u725b\u5382\u73b0\u5728\u8fd8\u90fd\u6ca1\u6709\u901a\u7535\u7535\u8bdd\u4fe1\u53f7\u4e5f\u6ca1\u6709\u4ea4\u901a\u4e5f\u5f88\u5dee.\u6240\u4ee5\u8001\u767e\u59d3\u5f88\u7a77\u554a.\u6211\u4eec\u90a3\u4e5f\u6ca1\u6709\u4ec0\u4e48\u7ecf\u6d4e\u6765\u6e90\uff0c\u6240\u4ee5\u6bcf\u5e74\u90fd\u51fa\u6765\u5f88\u8fdc\u7684\u5730\u65b9\u6765\u6253\u5de5\u517b\u6d3b\u5bb6\u91cc\u9762\u4eba.", "text": "\u6211\u6765\u81ea\u56db\u5ddd\u7701\u51c9\u5c71\u5dde\u6728\u91cc\u53bf.\u6211\u4eec\u6728\u91cc\u53bf\u8d2a\u5b98\u8150\u8d25\u5b58\u5728\u7684\u592a\u591a.\u6240\u4ee5\u4e2d\u592e\u8981\u91cd\u89c6\u6211\u8981\u4e3e\u62a5\u6728\u91cc\u53bf\u5e72\u90e8\u5de5\u4f5c\u4e0d\u8ba4\u771f\u4e0d\u8d1f\u8d23\u4efb\uff0c\u6bd4\u4e2a\u4f8b\u5b50\u5427\u6211\u4eec\u54ea\u4e2a\u6751\uff0c\u6728\u91cc\u53bf\u514b\u5c14\u4e61\u4e0a\u725b\u5382\u73b0\u5728\u8fd8\u90fd\u6ca1\u6709\u901a\u7535\u7535\u8bdd\u4fe1\u53f7\u4e5f\u6ca1\u6709\u4ea4\u901a\u4e5f\u5f88\u5dee.\u6240\u4ee5\u8001\u767e\u59d3\u5f88\u7a77\u554a.\u6211\u4eec\u90a3\u4e5f\u6ca1\u6709\u4ec0\u4e48\u7ecf\u6d4e\u6765\u6e90\uff0c\u6240\u4ee5\u6bcf\u5e74\u90fd\u51fa\u6765\u5f88\u8fdc\u7684\u5730\u65b9\u6765\u6253\u5de5\u517b\u6d3b\u5bb6\u91cc\u9762\u4eba.", "news_id": "weibo", "id": 837, "timestamp": 42834}
