{"content": "\u8fd1\u671f\uff0c\u4eba\u6c11\u65e5\u62a5\u520a\u6587\u62a5\u9053\uff0c\u6307\u51fa\u4e86\u4e0a\u6d77\u56fd\u8bda\u91d1\u878d\u7684\u95ee\u9898\uff0c\u4e2d\u56fd\u65b0\u95fb\u5468\u520a\u62a5\u9053\u662f\u5927\u6848\u8981\u6848\uff0c\u5e76\u6709\u9648\u65ed\u7684\u5f71\u5b50\u3002\u5357\u65b9\u90fd\u5e02\u62a5\uff0c\u4e2d\u91d1\u7f51\u3001\u5317\u4eac\u5546\u62a5\u90fd\u6307\u51fa\u56fd\u8bda\u91d1\u878d\u7684\u6b3a\u8bc8\u95ee\u9898\uff0c\u5e76\u6709\u5341\u51e0\u5bb6\u5a92\u4f53\u8f6c\u8f7d\u62a5\u9053\u56fd\u8bda\u4e8b\u4ef6\u3002\u56fd\u8bda\u8bc8\u9a97\u5168\u56fd7500\u51fa\u501f\u4eba4.5\u4ebf\u8d44\u91d1\uff0c\u8bc1\u636e\u786e\u51ff\u53ef\u8b66\u65b9\u5c31\u662f\u4e0d\u7acb\u6848\uff0c\u56fd\u8bda\u662f\u5426\u6709\u4fdd\u62a4\u4f1e\u671b\u5f7b\u67e5\uff0c\u8fd8\u793e\u4f1a\u4ee5\u516c\u5e73\u3002", "text": "\u8fd1\u671f\uff0c\u4eba\u6c11\u65e5\u62a5\u520a\u6587\u62a5\u9053\uff0c\u6307\u51fa\u4e86\u4e0a\u6d77\u56fd\u8bda\u91d1\u878d\u7684\u95ee\u9898\uff0c\u4e2d\u56fd\u65b0\u95fb\u5468\u520a\u62a5\u9053\u662f\u5927\u6848\u8981\u6848\uff0c\u5e76\u6709\u9648\u65ed\u7684\u5f71\u5b50\u3002\u5357\u65b9\u90fd\u5e02\u62a5\uff0c\u4e2d\u91d1\u7f51\u3001\u5317\u4eac\u5546\u62a5\u90fd\u6307\u51fa\u56fd\u8bda\u91d1\u878d\u7684\u6b3a\u8bc8\u95ee\u9898\uff0c\u5e76\u6709\u5341\u51e0\u5bb6\u5a92\u4f53\u8f6c\u8f7d\u62a5\u9053\u56fd\u8bda\u4e8b\u4ef6\u3002\u56fd\u8bda\u8bc8\u9a97\u5168\u56fd7500\u51fa\u501f\u4eba4.5\u4ebf\u8d44\u91d1\uff0c\u8bc1\u636e\u786e\u51ff\u53ef\u8b66\u65b9\u5c31\u662f\u4e0d\u7acb\u6848\uff0c\u56fd\u8bda\u662f\u5426\u6709\u4fdd\u62a4\u4f1e\u671b\u5f7b\u67e5\uff0c\u8fd8\u793e\u4f1a\u4ee5\u516c\u5e73\u3002", "news_id": "weibo", "id": 965, "timestamp": 42834}
