{"content": "\u5f00\u59cb\u56e0\u4e3a\u770b\u534e\u5c14\u8857\u5173\u6ce8\u4e86\u5085\u5cd9\u5cf0WSJ\u5fae\u535a\uff082012\u5e74\u5de6\u53f3\uff09\uff0c\u518d\u770b\u4ed6\u7ecf\u5e38\u548c\u5c0f\u7530\u4e92\u52a8\u5f88\u6709\u610f\u601d\uff0c\u5173\u6ce8\u4e86\u5c0f\u7530\uff0c\u5e94\u8be5\u633a\u65e9\u5c31\u5173\u6ce8\u516c\u53f7\u4e86\uff0c\u540e\u6765\u901a\u8baf\u5f55\u6574\u7406\u7684\u65f6\u5019\u53d1\u73b0\u4ed6\u628a\u6211\u7ed9\u5220\u6389\u4e86[\u59d4\u5c48]\u7279\u522b\u5173\u6ce8\u662f15\u5e74\u5c0f\u7530\u53d1\u201c\u4ee3\u8868\u5c48\u539f\u8001\u5bb6\u5b9c\u660c\u4eba\u6c11\u201d\uff0c1984\u4e5f\u89c9\u5f97\u5982\u6b64\u5e74\u8f7b\u6709\u4e3a[\u5077\u7b11]", "text": "\u5f00\u59cb\u56e0\u4e3a\u770b\u534e\u5c14\u8857\u5173\u6ce8\u4e86\u5085\u5cd9\u5cf0WSJ\u5fae\u535a\uff082012\u5e74\u5de6\u53f3\uff09\uff0c\u518d\u770b\u4ed6\u7ecf\u5e38\u548c\u5c0f\u7530\u4e92\u52a8\u5f88\u6709\u610f\u601d\uff0c\u5173\u6ce8\u4e86\u5c0f\u7530\uff0c\u5e94\u8be5\u633a\u65e9\u5c31\u5173\u6ce8\u516c\u53f7\u4e86\uff0c\u540e\u6765\u901a\u8baf\u5f55\u6574\u7406\u7684\u65f6\u5019\u53d1\u73b0\u4ed6\u628a\u6211\u7ed9\u5220\u6389\u4e86[\u59d4\u5c48]\u7279\u522b\u5173\u6ce8\u662f15\u5e74\u5c0f\u7530\u53d1\u201c\u4ee3\u8868\u5c48\u539f\u8001\u5bb6\u5b9c\u660c\u4eba\u6c11\u201d\uff0c1984\u4e5f\u89c9\u5f97\u5982\u6b64\u5e74\u8f7b\u6709\u4e3a[\u5077\u7b11]", "news_id": "weibo", "id": 1240, "timestamp": 42834}
